module.exports = "<div class=\"text-center mt-3 mb-5\">\n  <h1>Design principles</h1>\n  <p>Elements is the living design documentation of EPFL digital ecosystem</p>\n</div>\n\n<div class=\"container my-5 mb-5\">\n  <hr>\n</div>\n\n<div class=\"container my-5 mb-5\">\n  <h2>Our 3 design principles</h2>\n  <p>Our goal is to grow a single design system that supports a unified experience across all of EPFL platforms. To achieve this, we articulate our design desicions based on 3 master principles:</p>\n  <div class=\"card-deck\">\n    <div class=\"card\">\n      <picture class=\"card-img-top\">\n        <img src=\"./images/styleguide/illustrations/animation-clarity.gif\" class=\"img-fluid\" title=\"Clarity principle\" alt=\"A diamond that dispatch its sparkles\" />\n      </picture>\n      <div class=\"card-body\">\n        <h3>Clarity</h3>\n        <p>Our message is clear & understood. Clarity comes through intentional choices that support our values. Accessibility requires clarity.</p>\n      </div>\n    </div>\n    <div class=\"card\">\n      <picture class=\"card-img-top\">\n        <img src=\"./images/styleguide/illustrations/animation-balance.gif\" class=\"img-fluid\" title=\"Balance principle\" alt=\"A pendulum indicating the equilibrium of things\" />\n      </picture>\n      <div class=\"card-body\">\n        <h3>Balance</h3>\n        <p>We serve our own diversity. Balance comes from rational decisions on what we know and what we communicate. We seek harmony.</p>\n      </div>\n    </div>\n    <div class=\"card\">\n      <picture class=\"card-img-top\">\n        <img src=\"./images/styleguide/illustrations/animation-modularity.gif\" class=\"img-fluid\" title=\"Modularity principle\" alt=\"A square made of building blocks\" />\n      </picture>\n      <div class=\"card-body\">\n        <h3>Modularity</h3>\n        <p>Building blocks form or design system. We achieve consistency using those blocks. This versatility is the echo of our capacity to innovate.</p>\n      </div>\n    </div>\n  </div>\n</div>\n\n<div class=\"container\">\n  <div class=\"row my-5\">\n    <div class=\"col-lg-6 mb-3\">\n      <h2>3, III, Trois, Three</h2>\n      <img src=\"./images/styleguide/illustrations/three.png\" class=\"img-fluid mb-3\" title=\"Modularity principle\" alt=\"A square made of building blocks\" />\n      <p>It is our goto number: it evoques our 3 missions: <strong>Education</strong>, <strong>Research</strong> & <strong>Innovation</strong>. Pronounced the French way, it sounds like “free“.</p>\n    </div>\n    <div class=\"col-lg-6 mb-3\">\n      <h2>Atomic approach</h2>\n      <img src=\"./images/styleguide/illustrations/atomic-design-teaser.png\" class=\"img-fluid mb-3\" title=\"Modularity principle\" alt=\"A square made of building blocks\" />\n      <p>Elements component hierarchy is based on the <a href=\"http://bradfrost.com/blog/post/atomic-web-design/\" target=\"_blank\">Atomic Design approach</a>. User interface elements are construction bricks of various size and complexity.</p>\n    </div>\n  </div>\n</div>\n\n<div class=\"container my-5 mb-5\">\n  <hr>\n</div>\n";

