module.exports = "<div class=\"container text-center mt-5 mb-5\">\n  <h1>Elements</h1>\n  <p class=\"lead\">EPFL Web styleguide</p>\n  <hr>\n</div>\n\n<div class=\"container my-5\">\n  <h2>Dive in</h2>\n  <p>\n    The following pages will <b>introduce you to the styleguide</b> and <b>explain how you can use it</b>.\n  </p>\n  <div class=\"card-deck\">\n    <a href=\"#/doc/design--index.html\" class=\"card link-trapeze-horizontal\">\n        <div class=\"card-body\">\n          <picture class=\"card-img-top\">\n            <img src=\"./images/styleguide/illustrations/design-principles-teaser.png\" class=\"img-fluid\" title=\"Design Principles\" alt=\"3 Geometric shapes that inspired the Design Principles\" />\n          </picture>\n            <h3 class=\"card-title\">Design principles</h3>\n          <p class=\"card-text\">Guiding principles for our design decisions</p>\n        </div>\n    </a>\n    <!-- <a href=\"#/doc/how it works.md\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <picture class=\"card-img-top\">\n          <img src=\"./images/styleguide/illustrations/how-it-works-teaser.png\" class=\"img-fluid\" title=\"How Elements work \" alt=\"The shape of an atom to depict our design approach\" />\n        </picture>\n        <h3 class=\"card-title\">How it works</h3>\n        <p class=\"card-text\">A tour on how Elements is design and build</p>\n      </div>\n    </a> -->\n    <a href=\"#/doc/user%20documentation--index.md\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <picture class=\"card-img-top\">\n          <img src=\"./images/styleguide/illustrations/how-to-start-teaser.png\" class=\"img-fluid\" title=\"Start using Elements\" alt=\"Read to play with Elements?\" />\n        </picture>\n        <h3 class=\"card-title\">How to start</h3>\n        <p class=\"card-text\">A step-by-step guide to start using Elements</p>\n      </div>\n    </a>\n  </div>\n</div>\n\n<div class=\"container my-5\">\n  <h2>Visual design</h2>\n  <p>\n    Elements is about <b>digital communication and design</b>. Here is visual guidance for our styleguide.\n  </p>\n  <div class=\"card-deck\">\n    <a href=\"https://go.epfl.ch/identity\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <picture class=\"card-img-top\">\n          <img src=\"./images/styleguide/illustrations/brand-identity-teaser.png\" class=\"img-fluid\" title=\"Brand Identity\" alt=\"EPFL corporate branding is at the heart of the styleguide\" />\n        </picture>\n        <h3 class=\"card-title\">Brand Identity</h3>\n        <p class=\"card-text\">EPFL logo, brand guidelines and how to use them</p>\n      </div>\n    </a>\n    <a href=\"#/doc/design--typography.html\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <picture class=\"card-img-top\">\n          <img src=\"./images/styleguide/illustrations/typography-teaser.png\" class=\"img-fluid\" title=\"Typography\" alt=\"Text is 95% of what we see online: use typography properly, please!\" />\n        </picture>\n        <h3 class=\"card-title\">Typography</h3>\n        <p class=\"card-text\">Everything you need to know about setting up text</p>\n      </div>\n    </a>\n    <a href=\"#/atoms/icon\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <picture class=\"card-img-top\">\n          <img src=\"./images/styleguide/illustrations/iconography-teaser.png\" class=\"img-fluid\" title=\"Iconography\" alt=\"Icons and pictograms: symbols that give meaning to certain actions\" />\n        </picture>\n        <h3 class=\"card-title\">Iconography</h3>\n        <p class=\"card-text\">On the usage of icons and the available pictograms</p>\n      </div>\n    </a>\n    <a href=\"#/colors\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n\n        <h3 class=\"h3 card-title text-arrow mb-0\"><img src=\"./images/styleguide/illustrations/color-palette-teaser.png\" class=\"icon\" title=\"Color palette\" alt=\"Preview of EPFL color palette: 8 colors\" />&nbsp;Color palette</h3>\n      </div>\n    </a>\n  </div>\n</div>\n\n<div class=\"container-grid my-5\">\n  <h2>\n    <svg class=\"icon\" aria-hidden=\"true\" style=\"color:#A80E17;\"><use xlink:href=\"#icon-accessibility\"></use></svg> Accessibility\n  </h2>\n  <p>\n    Please read about the <strong>required accessibility recommendations</strong>.\n  </p>\n  <div>\n    <a href=\"#/doc/accessibility.html\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <picture class=\"card-img-top\">\n          <img src=\"./images/styleguide/illustrations/accessibility-teaser.png\" class=\"img-fluid\" title=\"Logo of the Accessibility initiative\" alt=\"A human silhouette with open arms\" />\n        </picture>\n        <h3 class=\"card-title\">Global Accessibility recommendations</h3>\n        <p class=\"card-text\">Information and rules to follow regarding accessibility (a11y)</p>\n      </div>\n    </a>\n  </div>\n</div>\n\n<div class=\"container-grid my-5\">\n  <h2>Reports</h2>\n  <p>\n    Set the necessary scripts to <b>analyse the audience's activity</b> on your site.\n  </p>\n  <div>\n    <a href=\"#/doc/user%20documentation--reports.md\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <h3 class=\"card-title text-arrow\">Site Analytics</h3>\n        <p class=\"card-text\">Information and howto to start generating reports</p>\n      </div>\n    </a>\n  </div>\n</div>\n\n<div class=\"container-grid my-5\">\n    <h2>&#128188; Legal obligation</h2>\n    <p>\n      Legal obligations on your site\n    </p>\n    <div>\n      <a href=\"#/organisms/cookie-consent\" class=\"card link-trapeze-horizontal\">\n        <div class=\"card-body\">\n          <h3 class=\"card-title\">Cookie consent &#127850;</h3>\n          <p class=\"card-text\">By using the styleguide, your website complies with the European cookie law by informing users that your site has cookies.</p>\n        </div>\n      </a>\n    </div>\n  </div>\n\n<div class=\"container-grid my-5\">\n  <h2>Contribute</h2>\n  <p>\n    Elements is Open Source. Help us <b>make the project better</b>:\n  </p>\n  <div>\n    <a href=\"#/doc/contribute--index.md\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <h3 class=\"card-title\">Contribution 🤝</h3>\n        <p class=\"card-text\">Guidelines for contributing to Elements (design + code + documentation)</p>\n      </div>\n    </a>\n  </div>\n</div>\n\n<div class=\"container-grid my-5\">\n  <h2>Feedback and support</h2>\n  <p>\n    A dedicated page to help you with <b>new requests</b>:\n  </p>\n  <div>\n    <a href=\"#/doc/contribute--support-and-request.html\" class=\"card link-trapeze-horizontal\">\n      <div class=\"card-body\">\n        <h3 class=\"h3 card-title text-arrow mb-0\">Support and requests ☝️</h3>\n      </div>\n    </a>\n  </div>\n</div>\n";

