module.exports = "<div class=\"grid\">\n    <ul class=\"link-list epfl-faq-header\">\n                <li>\n            <a href=\"#faq-item-1\">Why you should make an FAQ page</a>\n        </li>\n                <li>\n            <a href=\"#faq-item-2\">Is an egg a fruit or a vegetable?</a>\n        </li>\n                <li>\n            <a href=\"#faq-item-3\">How were unicorns made?</a>\n        </li>\n            </ul>\n        <div class=\"faq-item\" id=\"faq-item-1\">\n        <h4 class=\"faq-item-question\">Why you should make an FAQ page</h4>\n        An FAQ, or Frequently Asked Questions, page allows for visitors to find answers to all their questions in one place. Not only does it make life easier for your website visitors, it can save your time and resources because you don't have as many people contacting you for answers.\n    </div>\n        <div class=\"faq-item\" id=\"faq-item-2\">\n        <h4 class=\"faq-item-question\">Is an egg a fruit or a vegetable?</h4>\n        It is a fruit that grows from a plant called Eggnoramus Logicalus. Although the plant is low to the ground and is often a part of a vegetable farm, it is still a fruit, similar to tomato.\n    </div>\n        <div class=\"faq-item\" id=\"faq-item-3\">\n        <h4 class=\"faq-item-question\">How were unicorns made?</h4>\n        A kid with ice cream was like \"Ooh pony\". The kid tried to ride it but dropped his ice cream on the pony's head. The cone stayed and when the pony had a baby, the baby was an unicorn.\n    </div>\n    </div>\n";

